import React, { useEffect } from 'react';
import styles from './ServiceMain.module.css';
import Services from '../Services/Services';
import repair from '../../../Assets/Images/repair.png';
import phone from '../../../Assets/Images/phone.jpg';
import transfer from '../../../Assets/Images/money.png';
import cafe from '../../../Assets/Images/cafe.png';
// import aos from 'aos';
// import 'aos/dist/aos.css';



const ServiceMain = () => {

    // useEffect(() => {
    //     aos.init({})
    // }, []);

    return (
        <div className={styles.ServiceMain}>
            <h2>What you are Looking For Today</h2>
            <div className={styles.Ext}>
                <Services img={repair} title='Phone Repair'/>
                <Services img={cafe} title='Tablet Repair'/>
                <Services img={cafe} title='Laptop Repair'/>
                <Services img={cafe} title='Computer Repair'/>
                <Services img={cafe} title='Computer Assecories'/>
                <Services img={phone} title='Browse Phone'/>
                <Services img={transfer} title='Money Transfer'/>
                <Services img={cafe} title='Electronics'/>

            </div>
        </div>
    )
}

export default ServiceMain;
